import { Route, Routes } from "react-router-dom";
import Footer from "./components/Footer";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import InterviewGuidance from "./pages/InterviewGuidance";
import Jobs from "./pages/Jobs";
import Notifications from "./pages/Notifications";
import ResourceLinks from "./pages/ResourceLinks";
import Resume from "./pages/Resume";

function App() {
  return (
    <div>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/jobs" element={<Jobs />} />
        <Route path="/resume" element={<Resume />} />
        <Route path="/notifications" element={<Notifications />} />
        <Route path="/interview-guidance" element={<InterviewGuidance />} />
        <Route path="/resource-links" element={<ResourceLinks />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
